export default function Lista(props){
    return(<div id="listaHerramientas">
        <div className="tarjeta">
            {props.productos.map((item) => {
                return(
                    <div className="tarjeta" onClick={()=>console.log(item.id)}>
                        <p>{item.title}</p>
                    </div>
                )
            })}
        </div>
    </div>
    )
}
